import React from 'react'
import styled from 'styled-components'

const Container=styled.div`
position: absolute;
height: 120px;
left: 0px;
right: 0px;
top: 0px;

background: rgba(255, 255, 255, 0.96);
`

const Navbar = () => {
  return (
    <Container>
      Homepage
    </Container>
  )
}

export default Navbar
